import React from "react";
import UsersList from "../components/UsersList";

const Users = () => {
  const USERS = [
    {
      id: "user1",
      name: "Adeline",
      image: "http://www.w3.org/2000/svg",
      places: 3,
    },
  ];

  return <UsersList items={USERS} />;
};

export default Users;
